/* ==UserStyle==
@name           wirelyre dark
@namespace      github.com/openstyles/stylus
@version        1.0.0
@description    A new userstyle
@author         Me
==/UserStyle== */

@-moz-document url-prefix("https://wirelyre.github.io/tetra-tools/pc-solver.html") {
    /* Insert code here... */
    body {
        color: #fff; background-color: #363941; font-family: 'Lucidia Console', monospace;
    }
    #query { border-color: transparent; }
    #query details, #query details[open] { color: #ccc; }
    #queue {
        color: #fff; border: 1px solid rgba(0,0,0,0.3);
        background-color: rgba(0,0,0,0.2);
    }
    #initial-info, #query div.label { font-family: 'Lucidia Console', monospace; }
    #initial>input:nth-child(-n+10) { border-top: 1px solid rgba(0,0,0,0.3); }
    #initial>input:nth-child(10n+1) { border-left: 1px solid rgba(0,0,0,0.3); }
    #initial>input { background-color: rgba(0,0,0,0.2); border-right: 1px solid rgba(0,0,0,0.3); border-bottom: 1px solid rgba(0,0,0,0.3); }
    mino-board rect[fill='#F3F3ED'] { fill: rgba(0,0,0,0.2); }
    mino-board rect[fill='#E7E7E2'] { fill: rgba(0,0,0,0.2); }
}
